import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六己日丁卯时断</p><p>六己日生时丁卯，支干暗鬼枭虚神；</p><p>柱中有助方为福，无助难为显达人。</p><p>己日丁卯时，己以丁为印，乙为鬼，卯上明丁暗乙。</p><p>若岁月中无救助倚托者，虚秀不实，有成有败。</p><p>月中见辛制伏身旺者，贵；运旺，亦吉。</p><p>己丑日丁卯时，申子辰，武职。</p><p>亥卯未，荣富。</p><p>巳酉丑，行东北运，吉。</p><p>己卯日丁卯时，巳酉年月，制伏得宜。</p><p>庚申合煞，文进大贵。</p><p>子月，刑煞遇贵，主兵权或法官。</p><p>地支纯印或三合木局，运行寅，混官再遇流年冲运，凶死。</p><p>己巳日丁卯时，无冲破，富贵；寅午辰年月，刑伤不利。</p><p>亥月，木火运，贵。</p><p>若春生透甲乙者，官煞太旺，有制化，亦贵；否则凶夭。</p><p>乙未日丁卯时，不贵则富；卯戌亥丑年月，吉。</p><p>己酉日丁卯时，九成十破，未年旺。</p><p>年月通身生旺，干头有辛癸制伏丁乙者，吉。</p><p>己亥日丁卯时，秋生，偏官有制，富贵。</p><p>春寿促。</p><p>夏身旺，吉。</p><p>冬平常。</p><p>辰戌丑未月，贵。</p><p>己日卯时福自摧，求名求利总不宜；身宫但有刑克字，离乡别井走东西。</p><p>己日时逢丁卯，倒食偏官交加，酉庚辛破受波渣，思想不能通达。</p><p>父母雁行难望，落花后立根芽。</p><p>圆亏离祖可成家，发迹山林涧下。</p>",28),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","230卷 九·六己日丁卯时断.html.vue"]]);export{f as default};
